import React from "react";
import "./footer.scss";
import logo from "../../assets/images/eco-logo.png";

import { Container, Row, Col } from "reactstrap";
import { Link } from "react-router-dom";

const Footer = () => {
  return (
    <footer className="footer">
      <Container>
        <Row>
          <Col lg="4">
            <div className="logo">
              <img src={logo} alt="" />
              <div>
                <h1>Multimart</h1>
              </div>
            </div>
          </Col>

          <Col lg="3"></Col>
          <Col lg="2"></Col>
          <Col lg="4"></Col>
        </Row>
      </Container>
    </footer>
  );
};

export default Footer;
